[[package]]
name = "arrow"
version = "1.2.1"
requires_python = ">=3.6"
summary = "Better dates & times for Python"
dependencies = [
    "python-dateutil>=2.7.0",
]

[[package]]
name = "datetime"
version = "4.3"
summary = "This package provides a DateTime data type, as known from Zope. Unless you need to communicate with Zope APIs, you're probably better off using Python's built-in datetime module."
dependencies = [
    "pytz",
    "zope.interface",
]

[[package]]
name = "logging"
version = "0.4.9.6"
summary = "A logging module for Python"

[[package]]
name = "numpy"
version = "1.22.1"
requires_python = ">=3.8"
summary = "NumPy is the fundamental package for array computing with Python."

[[package]]
name = "pandas"
version = "1.4.0"
requires_python = ">=3.8"
summary = "Powerful data structures for data analysis, time series, and statistics"
dependencies = [
    "numpy>=1.18.5; platform_machine != \"aarch64\" and platform_machine != \"arm64\" and python_version < \"3.10\"",
    "numpy>=1.19.2; platform_machine == \"aarch64\" and python_version < \"3.10\"",
    "numpy>=1.20.0; platform_machine == \"arm64\" and python_version < \"3.10\"",
    "numpy>=1.21.0; python_version >= \"3.10\"",
    "python-dateutil>=2.8.1",
    "pytz>=2020.1",
]

[[package]]
name = "patsy"
version = "0.5.2"
summary = "A Python package for describing statistical models and for building design matrices."
dependencies = [
    "numpy>=1.4",
    "six",
]

[[package]]
name = "plotly"
version = "5.5.0"
requires_python = ">=3.6"
summary = "An open-source, interactive data visualization library for Python"
dependencies = [
    "six",
    "tenacity>=6.2.0",
]

[[package]]
name = "plotly.express"
version = "0.4.1"
summary = "Plotly Express - a high level wrapper for Plotly.py"
dependencies = [
    "numpy>=1.11",
    "pandas>=0.20.0",
    "patsy>=0.5",
    "plotly>=4.1.0",
    "scipy>=0.18",
    "statsmodels>=0.9.0",
]

[[package]]
name = "python-dateutil"
version = "2.8.2"
requires_python = "!=3.0.*,!=3.1.*,!=3.2.*,>=2.7"
summary = "Extensions to the standard Python datetime module"
dependencies = [
    "six>=1.5",
]

[[package]]
name = "pytz"
version = "2021.3"
summary = "World timezone definitions, modern and historical"

[[package]]
name = "pywebio"
version = "1.5.2"
requires_python = ">=3.5.2"
summary = "Write interactive web app in script way."
dependencies = [
    "tornado>=5.0",
    "user-agents",
]

[[package]]
name = "scipy"
version = "1.6.1"
requires_python = ">=3.7"
summary = "SciPy: Scientific Library for Python"
dependencies = [
    "numpy>=1.16.5",
]

[[package]]
name = "setuptools"
version = "60.5.0"
requires_python = ">=3.7"
summary = "Easily download, build, install, upgrade, and uninstall Python packages"

[[package]]
name = "six"
version = "1.16.0"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*"
summary = "Python 2 and 3 compatibility utilities"

[[package]]
name = "statsmodels"
version = "0.13.1"
requires_python = ">=3.7"
summary = "Statistical computations and models for Python"
dependencies = [
    "numpy>=1.17",
    "pandas>=0.25",
    "patsy>=0.5.2",
    "scipy>=1.3",
]

[[package]]
name = "tenacity"
version = "8.0.1"
requires_python = ">=3.6"
summary = "Retry code until it succeeds"

[[package]]
name = "tornado"
version = "6.1"
requires_python = ">= 3.5"
summary = "Tornado is a Python web framework and asynchronous networking library, originally developed at FriendFeed."

[[package]]
name = "ua-parser"
version = "0.10.0"
summary = "Python port of Browserscope's user agent parser"

[[package]]
name = "user-agents"
version = "2.2.0"
summary = "A library to identify devices (phones, tablets) and their capabilities by parsing browser user agent strings."
dependencies = [
    "ua-parser>=0.10.0",
]

[[package]]
name = "zope.interface"
version = "5.4.0"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
summary = "Interfaces for Python"
dependencies = [
    "setuptools",
]

